(964,'education','eğitim','/ˌɛdjʊˈkeɪʃn̩/',5,'noun','2016-06-17 AROP JOSEPH \"Education is the slight hammer that breaks the yoke of ignorance, and moulds knowledge, skills, ideas, good moral values in a person be it a child, a youth or full grown adult. no matter a persons age learning never stops\".','2016-06-17 AROP JOSEPH \"Eğitim, cehaletin boyunduruğunu kıran ve ister çocuk, ister genç, isterse yetişkin olsun bir kişide bilgiyi, becerileri, fikirleri, iyi ahlaki değerleri şekillendiren hafif bir çekiçtir. Kişinin yaşı ne olursa olsun öğrenme asla durmaz\".','https://translate.google.com/translate_tts?ie=UTF-8&q=education&tl=en&client=tw-ob',NULL,'level-5,advanced,noun,advanced-level','2024-11-20 00:46:06','2024-11-20 09:44:43'),
(965,'development','gelişim','/dɪˈvɛləpmənt/',5,'noun','The development of this story has been slow.','Bu hikayenin gelişimi yavaş ilerledi.','https://translate.google.com/translate_tts?ie=UTF-8&q=development&tl=en&client=tw-ob',NULL,'level-5,advanced,noun,advanced-level','2024-11-20 00:46:07','2024-11-20 09:44:52'),
(966,'success','başarı','/səkˈsɛs/',4,'noun','His third attempt to pass the entrance exam was a success.','Giriş sınavını geçmek için yaptığı üçüncü girişim de başarılı oldu.','https://translate.google.com/translate_tts?ie=UTF-8&q=success&tl=en&client=tw-ob','https://images.pexels.com/photos/25651531/pexels-photo-25651531.jpeg?auto=compress&cs=tinysrgb&h=350','level-4,noun,advanced-level','2024-11-20 00:46:08','2024-11-20 00:46:08'),
